import matplotlib.pyplot as plt
from matplotlib.patches import FancyArrowPatch, Circle

class Node:
    def __init__(self, value):
        self.left = None
        self.data = value
        self.right = None

class Tree:
    def createNode(self, data):
        return Node(data)

    def insert(self, node, data):
        if node is None:
            return self.createNode(data)

        if data < node.data:
            node.left = self.insert(node.left, data)
        else:
            node.right = self.insert(node.right, data)
        return node

    def traverse_inorder(self, root):
        if root is not None:
            self.traverse_inorder(root.left)
            print(root.data)
            self.traverse_inorder(root.right)

    def traverse_preorder(self,root):
       if root is not None:
        print(root.data)
        self.traverse_preorder(root.left)
        self.traverse_preorder(root.right)

    def traverse_postorder(self,root):
       if root is not None:
        self.traverse_preorder(root.left)
        self.traverse_preorder(root.right)
        print(root.data)

def plot_tree(ax, node, x, y, dx, dy, level=0):
    if node is not None:
        circle = Circle((x, y), 0.05, color='blue', ec='black')
        ax.add_patch(circle)
        ax.text(x, y, str(node.data), va='center', ha='center', color='white', fontsize=12)
        if node.left is not None:
            x_left = x - 0.25 * dx
            y_left = y - dy
            ax.add_patch(FancyArrowPatch((x, y - 0.05), (x_left, y_left + 0.05), mutation_scale=15, color='black'))
            plot_tree(ax, node.left, x_left, y_left, dx / 2, dy, level + 1)
        if node.right is not None:
            x_right = x + 0.25 * dx
            y_right = y - dy
            ax.add_patch(FancyArrowPatch((x, y - 0.05), (x_right, y_right + 0.05), mutation_scale=15, color='black'))
            plot_tree(ax, node.right, x_right, y_right, dx / 2, dy, level + 1)


