"""***Binary Tree: it can have at most 2 children in the tree, sorting is difficult***"""

class Node:
  def __init__(self,key):
    self.left = None
    self.right = None
    self.val = key

  def preorder(self):
    print(self.val, end = " ")
    if self.left:
      self.left.preorder()
    if self.right:
      self.right.preorder()

  def inorder(self):
    if self.left:
      self.left.inorder()
    print(self.val, end = " ")
    if self.right:
      self.right.inorder()

  def postorder(self):
    if self.left:
      self.left.postorder()
    if self.right:
      self.right.postorder()
    print(self.val, end = " ")


