"""***Binary Search Tree: It is tree with following additional restrictions ; Left child must always be less than root node, Right child must always be greater than root node, sorting is difficult***   ![image.png](data:image/png;base64,)"""

class Node:
  def __init__(self, key):
    self.key = key
    self.left = None
    self.right = None

def inorder(root):
  if root is not None:
    inorder(root.left)
    print(str(root.key) + "->", end = "")
    inorder(root.right)

def insert(node,key):
  if node is None:
    return Node(key)

  if key < node.key:
    node.left = insert(node.left, key)
  else:
    node.right = insert(node.right, key)
  return node

def minValueNode(node):
  current = node

  while(current.left is not None):
    current = current.left

  return current

def deleteNode(root,key):
  if root is None:
    return root

  if key < root.key:
    root.left = deleteNode(root.left, key)
  elif(key > root.key):
    root.right = deleteNode(root.right, key)
  else:
    if root.left is None:
      temp = root.right
      root = None
      return temp

    elif root.right is None:
      temp = root.left
      root = None
      return temp

    #if the node has two children, place the inorder successsor in position of the node to be deelted
    temp = minValueNode(root.right)
    root.key = temp.key

    #delete the inorder successor
    root.right = deleteNode(root.right, temp.key)

  return root

