"""# ***Graph: It is collections of vertices and edges, vertices represents data and edges represents relationships between data***"""

class Graph:
    def __init__(self):
        self.nodes = set()
        self.edges = {}

    def add_node(self, node):
        self.nodes.add(node)
        self.edges[node] = []

    def add_edge(self, node1, node2):
        self.edges[node1].append(node2)
        self.edges[node2].append(node1)

    def get_neighbors(self, node):
        return self.edges[node]

    def remove_node(self, node):
      # Remove the node from the set of nodes
        self.nodes.remove(node)

      # Remove the node and its associated edges from the edges dictionary
        del self.edges[node]

      # Remove references to the node from the edge lists of other nodes
        for n in self.nodes:
            if node in self.edges[n]:
                self.edges[n].remove(node)

    def remove_edge(self, node1, node2):
      # Remove node2 from the list of neighbors of node1
        if node2 in self.edges[node1]:
            self.edges[node1].remove(node2)

      # Remove node1 from the list of neighbors of node2
        if node1 in self.edges[node2]:
            self.edges[node2].remove(node1)


    def display(self):
        print("Nodes:", self.nodes)
        print("Edges:", self.edges)


