import networkx as nx
import matplotlib.pyplot as plt

class Graph:
    def __init__(self):
        self.nodes = set()
        self.edges = {}

    def add_node(self, node):
        self.nodes.add(node)
        self.edges[node] = []

    def add_edge(self, node1, node2):
        self.edges[node1].append(node2)
        self.edges[node2].append(node1)

    def get_neighbors(self, node):
        return self.edges[node]

    def remove_node(self, node):
        self.nodes.remove(node)
        del self.edges[node]
        for n in self.nodes:
            if node in self.edges[n]:
                self.edges[n].remove(node)

    def remove_edge(self, node1, node2):
        if node2 in self.edges[node1]:
            self.edges[node1].remove(node2)
        if node1 in self.edges[node2]:
            self.edges[node2].remove(node1)

    def display(self):
        G = nx.Graph()
        G.add_nodes_from(self.nodes)
        for node, neighbors in self.edges.items():
            G.add_edges_from((node, neighbor) for neighbor in neighbors)

        pos = nx.circular_layout(G)

        node_labels = {node: str(node) for node in G.nodes()}

        nx.draw(G, pos, with_labels=True, labels=node_labels, node_size=500, node_color='black', font_color='white')
        plt.show()


