"""**Singly Linked List**"""

class Node:
    def __init__(self, data, next=None):
        self.data = data
        self.next = next

class LinkedList:
    def __init__(self, head=None):
        self.head = head

    def add(self, data):
        new_node = Node(data)
        if self.head:
            temp = self.head
            while temp.next is not None:
                temp = temp.next
            temp.next = new_node
        else:
            self.head = new_node

    def display(self):
        current_node = self.head
        while current_node:
            print(current_node.data, end=" -> ")
            current_node = current_node.next
        print("None")


    #inserting values in a linked list in the beginning
    def insert(self, new =None):
        self.new = new
        newNode = Node(new)
        newNode.next = self.head
        self.head = newNode

    #inserting values in the end of the linked list
    def insertend(self, new = None):
        self.new = new
        new = Node(new)
        last_node = self.head
        while(last_node.next):
          last_node = last_node.next
        last_node.next = new

    #inserting value inbetween
    def insertmid(self, data, x):
      self.data = data
      self.x = x
      temp = self.head
      newNode = Node(data)
      while(temp):
        if (temp.data == x):
          newNode.next = temp.next
          temp.next = newNode
        temp = temp.next

    #deleting a value
    def delete(self, value):
      temp = self.head
      while(temp !=None):
        if temp.data== value:
          break
        prev = temp
        temp = temp.next
      prev.next = temp.next


    #searching value
    def search(self,x):
      current = self.head
      while current !=None:
        if (current.data == x):
          print("Found")
        else:
          print("Not found")
        current = current.next

    #sorting linked list
    def sort(self):
      temp = self.head
      a = []
      while(temp):
        a.append(temp.data)
        temp = temp.next
      a.sort()
      new = LinkedList()
      for i in a:
        new.add(i)
      new.display()



